import { NgModule } from "@angular/core";
import { BrowserModule } from "@angular/platform-browser";
import { RouterModule, Routes } from "@angular/router";

import { AppComponent } from "./app.component";
import { HeaderComponent } from "./components/header/header";
import { FooterComponent } from "./components/footer/footer";
import { AcademyComponent } from "./pages/academy/academy";

const routes: Routes = [
  { path: "", redirectTo: "/community", pathMatch: "full" },
  { path: "community", component: AcademyComponent },
  { path: "home", component: AcademyComponent },
  { path: "quotes", component: AcademyComponent },
  { path: "wealth", component: AcademyComponent },
  { path: "portfolio", component: AcademyComponent },
  { path: "profile", component: AcademyComponent },
];

@NgModule({
  declarations: [
  ],
  imports: [BrowserModule, RouterModule.forRoot(routes), HeaderComponent],
  providers: [],
  bootstrap: [],
})
export class AppModule {}
